import styled from 'styled-components';
import Header from '../components/Header';

const ContactStyles = styled.div`
  display: grid;
  grid-template-columns: 1fr 3fr 1fr;
  grid-template-rows: 60px auto;
  align-items: center;
  #title {
    grid-column: 2;
    grid-row: 1;
  }
  #contact{
    grid-column: 2;
    grid-row: 2;
  }
`;
export default function ContactPage() {
  return (
    <ContactStyles>
      <Header />
      <div><h1>Contact Us!</h1></div>
      <div>      <p>
        Ataire, 1557 London Road, Norbury London, SW16 4AD, Tell +442038932944
      </p>
      <a href="mailto:Ataire.online@gmail.com">Email Ataire</a></div>

    </ContactStyles>
  );
}
